export default function Profissinais(){
    return(
        <div className="main-container">
            <div>
                <ul>
<li>
    <img src="http://blogrh.com.br/wp-content/uploads/2017/11/10-Caracter%C3%ADsticas-que-o-profissional-de-RH-deve-ter.jpg"></img>
        <footer>
            <strong>Ana Carolina</strong>
            <h2>Advogada</h2>
            <p>Trabalho com advocacia há mais de 15 anos e levo meu trbalho muito a sério.</p>

        </footer>
    
</li>
                </ul>
            </div>
        </div>
    );
}
